Column.Formula:
LET $calculation := IF(
	[Organisation or Not] = "Organisation",
	[Date Incident Closed]- [Date Reported to Organisation Privacy Team],
	[Date Incident Closed]-[Date of Alleged Incident or Received by Agent]
);

RETURN IF([Date Incident Closed]!=NULL(), ROUND($calculation), 0)

